import React, { useState } from "react";
import Modal from "react-modal";
import Container from "react-bootstrap/Container";
import { Row, Col } from "react-bootstrap";
import { Button } from "@mui/material";
import { Height } from "@mui/icons-material";
import masla_logo from "../Assests/masla_logo.png";
import TextField from "@mui/material/TextField";

// Set the app element for accessibility
Modal.setAppElement("#root");

const customModalStyles = {
  content: {
    width: "60%", // Set the desired width
    height: "90vh", // Set the desired height
    margin: "auto", // Center the modal horizontally
    padding: "0",
  },
};

const AddRequestUser = ({ isOpen, setIsOpen }) => {
  //   const [isOpen, setIsOpen] = useState(false);
  //   const openModal = () => {
  //     setIsOpen(true);
  //   };
  //   const closeModal = () => {
  //     setIsOpen(false);
  //   };
}

const closeModal = () => {
  const [isOpen, setIsOpen] = useState(false);
  setIsOpen(false);
};

const ValidateEmployeeNumber = () => {
  const [employeeNumber, setEmployeeNumber] = useState("");
  const [error, setError] = useState(false);
  const [helperText, setHelperText] = useState("");

  const handleIdChange = (event) => {
    setEmployeeNumber(event.target.value);
  };

  const validateId = () => {
    if (employeeNumber.length === 0) {
      setError(true);
      setHelperText("Employee Number is required");
    } else if (employeeNumber.length > 5 || employeeNumber.length < 4) {
      setError(true);
      setHelperText("Numer Should have 4 digits");
    } else if (!/^\d+$/.test) {
      setError(true);
      setHelperText("Employee Number should be a number");
    } else {
      setError(false);
      setHelperText("");
      // Perform any additional validation or submit the form here
    }
  };

  return (
    <div>
      {/* <button onClick={openModal}>Open Popup</button> */}

      <Modal
        isOpen={isOpen}
        onRequestClose={closeModal}
        style={customModalStyles}
      >
        <Container style={{ height: "100%", width: "100%", margin: "0" }}>
          <Row style={{ height: "15%", backgroundColor: "#1F294A" }}>
            <Container style={{ height: "100%" }}>
              <img src={masla_logo} alt="logo" height={"100%"} />
            </Container>
          </Row>
          <Row
            style={{
              height: "77%",
              justifyContent: "center",
              display: "flex",
              verticalAlign: "center",
            }}
          >
            <Container
              style={{
                width: "90%",
                height: "90%",
                backgroundColor: "#D9D9D9",
                justifyContent: "center",

                marginTop: "3%",
                borderRadius: "7px",
              }}
            >
              <Row style={{ height: "50%", padding: "1%" }}>
                <Row style={{ fontWeight: "bold" }}>Personal Information</Row>
                <Row>
                  <Col>Employee Number :</Col>
                  <Col>
                    <TextField
                      label="Employee Number"
                      value={employeeNumber}
                      onChange={handleIdChange}
                      error={error}
                      helperText={helperText}
                    />
                  </Col>
                </Row>
              </Row>
              <Row style={{ height: "50%", padding: "1%" }}>sdf</Row>
            </Container>
          </Row>

          <Row
            style={{
              height: "8%",
              backgroundColor: "#1F294A",
              justifyContent: "center",
            }}
          >
            <Container
              style={{
                height: "100%",
                width: "100%",
                justifyContent: "center",
                display: "flex",
              }}
            >
              <Button
                variant="contained"
                style={{
                  height: "70%",
                  width: "10%",
                  marginLeft: "1%",
                  marginRight: "1%",
                  marginTop: "1%",
                  backgroundColor: "#FB6340",
                }}
              >
                ADD
              </Button>
              <Button
                variant="contained"
                style={{
                  height: "70%",
                  width: "10%",
                  marginLeft: "1%",
                  marginRight: "1%",
                  marginTop: "1%",
                  backgroundColor: "#FB6340",
                }}
                onClick={closeModal}
              >
                Cancel
              </Button>
            </Container>
          </Row>

          {/* <button onClick={closeModal}>Close</button> */}
        </Container>
      </Modal>
    </div>
  );
};

export default AddRequestUser;
